	if ( !p2 ) p2 = p1
	if ( tail ) p2 += tail
		return '<a href='+mw.config.get('wgServer')+'/wiki/'  + encodeURI(p1.replace(/\?/g,'%3F').replace(/&/g,'%26'))
			+' title=\'' + p1 + '\'>' + p2 + '</a>' })
