/*
Новое оформление шаблона [[Шаблон:Раздел заглавной страницы]]

Основано на:
https://github.com/wikimedia/wikimedia-ui-base/blob/master/wikimedia-ui-base.less
https://design.wikimedia.org/style-guide/
*/
.main-box {
	background: #fff;
	border: solid #c8ccd1;
	border-width: 1px 0;
	box-shadow: 0 1px 1px rgba( 0, 0, 0, 0.15 );
	margin: 0 -1rem 1.5rem;
	padding: 1rem;
}

.main-box > p:last-child {
	 margin-bottom: 0;
}

/* Изображение дня */
.main-box-image-only > .main-box-content {
	margin: 0.5rem -1rem 0;
	text-align: center;
}

.main-box-image-only > .main-box-content img {
	height: auto;
	max-width: 100%;
}

.main-box-imageCaption {
	text-align: center;
}

.main-box-imageCaption > p {
	display: inline-block;
	margin-bottom: 0;
	text-align: left;
}

/* Надзаголовок */
.main-box-subtitle {
	color: #72777d;
	line-height: 1.25;
	margin-top: -.125em; /* Балансирование верхней границы надзаголовка из-за line-height: 1.25; */
}

/* Заголовок */
.main-box-header {
	margin-top: -.15em; /* Балансирование верхней границы заголовка из-за line-height: 1.3; */
}

.main-box-header a {
	color: inherit;
}

.main-box-subtitle + .main-box-header { /* При появлении надзаголовка сбрасываем margin на стандартное значение */
	margin-top: 0;
}

.main-box-header a:focus,
.main-box:hover .main-box-header a,
.main-box:hover .main-featuredLists-item > a {
	color: #0645ad;
}

/* Подвал */
.main-footer {
	display: flex;
	justify-content: flex-end;
	margin-top: 1rem;
	position: relative;
}

.main-footer:empty {
	display: none;
}

.main-footer-actions {
	flex: 1;
}

.main-footer-actions > ul {
	align-items: center;
	display: flex;
}

/* Меню */
.main-footer-menu {
	align-items: stretch;
	display: flex;
}

.main-footer-menuToggle {
	align-items: center;
	display: flex;
	float: none;
	height: 100%;
	opacity: 0.87;
}

.main-footer-menuToggle:hover {
	opacity: 0.51;
}

/* Выпадайка */
.main-footer-menuDropdown {
	background: #fff;
	border: 1px solid #a2a9b1;
	border-radius: 2px;
	box-shadow: 0 2px 2px 0 rgba( 0, 0, 0, 0.25 );
	max-width: 15em;
	position: absolute;
	right: 0;
	top: 100%;
	z-index: 100;
}

.main-footer-menuDropdown .mw-ui-button {
	text-align: left;
	width: 100%;
}

/*
Мобильные
*/
@media (max-width: 719px) {
	.main-box-responsive-image > .floatleft,
	.main-box-responsive-image > .floatright {
		float: none;
		margin-left: -1rem;
		margin-right: -1rem;
		text-align: center;
	}

	.main-box-responsive-image > .floatleft > a,
	.main-box-responsive-image > .floatright > a {
		display: block;
	}
}

/*
Планшеты
*/
@media (min-width: 720px) {
	.main-box {
		border-radius: 2px;
		border-width: 1px;
		margin-bottom: 1rem;
		margin-left: 0;
		margin-right: 0;
	}
}

/*
Стационарные компьютеры
*/
@media (min-width: 1000px) {
	.main-box {
		margin-bottom: 1.5rem;
		padding: 1.5rem;
	}

	.main-box-image-only > .main-box-content {
		margin-left: -1.5rem;
		margin-right: -1.5rem;
	}
}

